import { Route, BrowserRouter, Routes } from "react-router-dom";
import MainPageContent from './Components/MainPageContent';
import NavBar from "./Components/NavBar";
import GamesSearch from "./Components/GameSearch";
import Games from "./Components/GameCard";

function App(){

  return(

    <body>
      <BrowserRouter>
      <NavBar /> 
        <Routes>
        <Route path="/Project_3_Clickplay" element={ <MainPageContent/>} />

        <Route path="/Project_3_Clickplay/gamesearch" element={ <GamesSearch/> } />
        </Routes>
      </BrowserRouter>
      <footer className="footer">  
           <p><small> Copyright 2022 </small> </p>
           <p><small> A Something Else Production </small> </p>
           </footer>       
    </body>


  )
}

export default App;
